import React from 'react';
import ReactDOM from 'react-dom';
import {
	Router,
  Route,
  Link,
  NavLink
} from 'react-router-dom';

import Upload from './components/upload';
import MissingEntry from './components/missingEntry';
import MoreInfo from './components/moreinfo';

import './assets/styles/app.css';




class App extends React.Component{

	constructor(props){
		super(props);

	}


render(){
	return(
		<div>
		<div>
		<h1> Missing persons portal</h1>

		 <NavLink to='/missinginfo' >Missing person information</NavLink>


          <NavLink to='/upload'> Upload information</NavLink>

          <NavLink to='/moreinfo'> More information</NavLink>

        </div>

        <div className="navbar">

            <Route path ="/missinginfo" component={MissingEntry}/>

            <Route exact path ="/upload" component={Upload}/>

            <Route path ="/moreinfo" component={MoreInfo}/>

        </div>
        </div>


		)
	}


}


export default App;
